sys_variable_value.value:
(function execute(inputs, outputs) {
  if(inputs['status']==200){
    var results = JSON.parse(inputs['responseBody']).results;
    outputs['contracts_number'] = results.contracts;
    outputs['direct_payments_number'] = results.direct_payments;
    outputs['grants_number'] = results.grants;
    outputs['idvs_number'] = results.idvs;
    outputs['loans_number'] = results.loans;
    outputs['other_number'] = results.other;
  }
})(inputs, outputs);

