sys_variable_value.value:
(function execute(inputs, outputs) {

  var naics = JSON.parse(inputs['naics']);
  var bodyReq = {
    "filters": {
      "time_period": [
        {
          "start_date": inputs['startDate'].toString(),
          "end_date": inputs['endDate'].toString()
        }
      ],
      "agencies": [getAgencie(inputs['fundingAgencie'], 'funding'), getAgencie(inputs['fundingAgencie'], 'awarding')
      ],
      "naics_codes": naics
    },
    "subawards": false
  };

  gs.info('Calling USA Spending award count API -> {0}',JSON.stringify(bodyReq));
  outputs['req_body'] = JSON.stringify(bodyReq);

  function getAgencie(name, type) {
  	if(name == 'U.S. Census Bureau') {
    	return {tier: "subtier", name: "U.S. Census Bureau", toptier_name: "Department of Commerce", type: type };
    } else if(name == 'Internal Revenue Service') {
    	return {tier: "subtier", name: "U.S. Census Bureau", toptier_name: "Department of the Treasury", type: type};
    } else {
    	return {tier: "subtier", name: "Food and Drug Administration", toptier_name: "Department of Health and Human Services", type: type};
    }
  }
})(inputs, outputs);

